import App from "./App";
export default function Contact(props) {
  return (
    <div className="contacts">
      <img src={props.img} alt="error" />
      <h3>{props.name}</h3>

      <div className="info-grp">
        <p>{props.phone}</p>
      </div>

      <div className="info-grp">
        <p>{props.email}</p>
      </div>
    </div>
  );
}
